function dt() {
  const now = new Date();
  const year = now.getFullYear();
  const month = now.getMonth() + 1;
  const date = now.getDate();
  const hours = now.getHours();
  const minutes = now.getMinutes();
  const seconds = now.getSeconds();
  return `${year}-${month}-${date} ${hours}:${minutes}:${seconds}`
}

async function getTravelAlarm(country: any) {
  try {
    const BASE_URL = 'https://apis.data.go.kr/1262000/TravelAlarmService2/getTravelAlarmList2';
    const response = await axios.get(`${BASE_URL}`, {
      params: {
        serviceKey: ServiceKey,
        returnType: "JSON",
        numOfRows: 1,
        pageNo: 1,
        "cond[country_iso_alp2::EQ]": country,
      }
    });
    const data = response.data.data[0];
    return {
      id: country,
      lv: data.alarm_lvl === null ? 0 : data.alarm_lvl,
      content: data.remark === null ? '정보 없음' : data.remark,
      url: data.dang_map_download_url,
      embassy: await getEmbassy(country)
    }
  } catch (error) {
    return {
      id: country,
      lv: 0,
      content: '정보 없음',
      url: '정보 없음',
      embassy: await getEmbassy(country)
    };
  }
}

async function getEmbassy(country: any) {
  try {
    const BASE_URL = 'https://apis.data.go.kr/1262000/EmbassyService2/getEmbassyList2';
    const response = await axios.get(`${BASE_URL}`, {
      params: {
        serviceKey: ServiceKey,
        returnType: "JSON",
        numOfRows: 1,
        "cond[country_iso_alp2::EQ]": country,
        pageNo: 1
      }
    });
    const data = response.data.data[0];
    return { name: data.embassy_kor_nm, address: data.emblgbd_addr, tel: data.tel_no, etel: data.urgency_tel_no }
  } catch (error) {
    return { name: '정보 없음', address: '정보 없음', tel: '정보 없음', etel: '정보 없음' };
  }
}

